
function addImage(){
    const img = document.createElement("img");
}

// Define the Base64 string here
img.src = "data:image/png;base64,";



 // Append the image to a specific element in the HTML (like a div with id "image-container")
 document.getElementById("Nmap").appendChild(img);

 // Call the function to add the image when the script loads
window.onload = addImage;

